import { sameArray, camelCase, isType, clone, hasPath, setPath } from './utils';
import { getChart } from './getChart';
var utils = {
    sameArray: sameArray,
    camelCase: camelCase,
    isType: isType,
    clone: clone,
    hasPath: hasPath,
    setPath: setPath,
};
export { utils, getChart };
